import React, { useState } from 'react';
import { Link } from 'react-router-dom';

import { Container } from './style';

function history(){
    let target = <Link to='/addcurso'></Link>
    return target;
}


const Consulta: React.FC = () => {
  return (
    <Container>
        <form>
            <h1 className='Titulo'>
                Consulta
            </h1>
            <Link to='/addcurso' cl>Adicionar Curso</Link>
            <button>Ver Curso</button>
            <button className='button--atualizar'>Atualizar Cruso</button>
            <button className='button--delete'>Deletar Curso</button>
            <br />
            <Link to='/'>
                Voltar para a Home.
            </Link>
        </form>
    </Container>
  );
}

export default Consulta;
